  const script = document.createElement("script");
  const cloudinaryWidget = document.createElement("script");
  script.src = "https://widget.cloudinary.com/v2.0/global/all.js";
  script.type = "text/javascript";
  cloudinaryWidget.type = "text/javascript";
  let myWidget = cloudinaryWidget.createUploadWidget({
      uploadPreset: "my_preset"}, (error, result) => { console.log(error, result) }
  ); 
  myWidget.open();
  document.body.appendChild(script);
}


function ImageUploadForm(props) {

